(917, '__404__', '__404__', '__404__', '<h1>404: Не найдено</h1><h4>Извините, но содержимое, которое Вы запросили не найдено</h4>', '', 1, 0, 0, 0, '2009-01-09 12:00:00', 62, '', '2010-12-16 11:36:29', 62, 62, '2011-05-31 07:10:47', '2009-01-09 12:00:00', '0000-00-00 00:00:00', '', '', 'menu_image=-1\nshow_title=0\nshow_section=0\nshow_category=0show_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\npageclass_sfx=', 1, 0, 4, 'запросили, содержимое, найдено, найденоизвините, 404, __404__', '', 0, 493, ''),
(928, 'Реклама на сайте', 'advertise-on-this-site', '', '<h3>Правила размещения рекламных материалов</h3>\r\n<p><strong>На сайте запрещается публикация рекламных материалов таких как:</strong></p>\r\n<p></p>\r\n<ul>\r\n  <li>Любые порнографические материалы и ссылки на них.</li>\r\n  <li>Информацию, содержание и цели которой противоречат УК РФ.</li>\r\n  <li>Ссылки и баннеры ведущие на сайты с вредоносным содержимым (ПО).</li>\r\n  <li>Любые националистические лозунги и высказывания ведущие к межнациональной ненависти и розни.</li>\r\n  <li>Любая Анти-реклама.</li>\r\n</ul>\r\n\r\n<p>По вопросам размещения рекламы обращайтесь к Администратору сайта.</p>', '', 1, 0, 0, 0, '2010-12-27 14:30:25', 62, '', '2011-05-31 07:09:04', 62, 0, '0000-00-00 00:00:00', '2010-12-27 14:30:25', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 11, 0, 3, 'любые, реклама, ссылки, ведущие, сайте, рекламных, размещения, материалов, националистические, высказывания, лозунги, межнациональной, содержимым, анти, обращайтесь, администратору, сайта, рекламы, вопросам, розни', 'Правила размещения рекламных материалов На сайте запрещается публикация рекламных материалов таких как: Любые порнографические материалы и ссылки на них. Информацию, содержание и цели которой противор', 0, 9, 'robots=\nauthor='),
(943, 'Авторизация', 'authorization', '', '<p>Только зарегистрированные пользователи могут добавлять на сайт новости. Пожалуйста, авторизуйтесь и нажмите кнопку "Добавить новость".</p>\r\n\r\n{module 239|none}', '', 1, 0, 0, 0, '2011-01-14 08:35:01', 62, '', '2011-05-03 17:12:27', 62, 0, '0000-00-00 00:00:00', '2011-01-14 08:35:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 10, 0, 1, 'авторизуйтесь, пожалуйста, нажмите, кнопку, новость, добавить, новости, зарегистрированные, только, пользователи, могут, сайт, добавлять, авторизация', 'Только зарегистрированные пользователи могут добавлять на сайт новости. Пожалуйста, авторизуйтесь и нажмите кнопку ''Добавить новость''.', 0, 123, 'robots=\nauthor=');
