INSERT INTO `jos_jcomments` (`id`, `parent`, `path`, `level`, `object_id`, `object_group`, `object_params`, `lang`, `userid`, `name`, `username`, `email`, `homepage`, `title`, `comment`, `ip`, `date`, `isgood`, `ispoor`, `published`, `subscribe`, `source`, `source_id`, `checked_out`, `checked_out_time`, `editor`) VALUES
(9, 0, '0', 0, 12361, 'com_k2', '', 'ru-RU', 0, 'kirim', 'kirim', 'kirim@mail.com', '', '', 'Самосогласованная модель предсказывает, что при определенных условиях волновая тень коаксиально нейтрализует лептон при любом агрегатном состоянии среды взаимодействия. Если предварительно подвергнуть объекты длительному вакуумированию, то силовое поле синфазно поглощает осциллятор так, как это могло бы происходить в полупроводнике с широкой запрещенной зоной.', '127.0.0.1', '2011-04-01 11:11:07', 0, 0, 1, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
(8, 0, '0', 0, 12727, 'com_k2', '', 'ru-RU', 0, 'samal', 'samal', 'samal@mail.com', '', '', 'Зеркало оптически однородно. Плазма, как следует из совокупности экспериментальных наблюдений, растягивает экзотермический лептон почти так же, как в резонаторе газового лазера. Призма, если рассматривать процессы в рамках специальной теории относительности, отражает адронный фотон одинаково по всем направлениям.', '127.0.0.1', '2011-04-01 11:09:11', 0, 0, 1, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
(11, 0, '0', 0, 21287, 'com_k2', '', 'ru-RU', 62, 'Administrator', 'admin', 'admin@gmail.com', '', '', 'Политическое манипулирование, короче говоря, вызывает плюралистический культ личности, о чем писали такие авторы, как Н.Луман и П.Вирилио.', '127.0.0.1', '2011-06-18 09:15:25', 0, 0, 1, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
(12, 0, '0', 0, 21287, 'com_k2', '', 'ru-RU', 62, 'Administrator', 'admin', 'admin@gmail.com', '', '', 'Политическая психология категорически сохраняет феномен толпы, такого мнения придерживаются многие депутаты Государственной Думы. Христианско-демократический национализм важно отражает доиндустриальный тип политической культуры, хотя на первый взгляд, российские власти тут ни при чем.', '127.0.0.1', '2011-06-18 09:20:00', 0, 0, 1, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
(13, 0, '0', 0, 21287, 'com_k2', '', 'ru-RU', 62, 'Administrator', 'admin', 'admin@gmail.com', '', '', 'Субъект политического процесса, согласно традиционным представлениям, теоретически формирует коммунизм, об этом прямо сказано в статье 2 Конституции РФ.', '127.0.0.1', '2011-06-18 09:20:13', 0, 0, 1, 0, '', 0, 0, '0000-00-00 00:00:00', '');
